import { Fragment, useEffect, useState } from "react";
import { useSelector } from "react-redux";
import { Redirect, Route } from "react-router";
import { TOKEN, USER_LOGIN } from "../../util/settings/config";
import { Layout, Menu, Breadcrumb, Dropdown } from "antd";
import {
  DownOutlined,
  MenuOutlined,
  PlusOutlined,
  UnorderedListOutlined,
  UserAddOutlined,
  UserOutlined,
  VideoCameraOutlined,
} from "@ant-design/icons";
import { NavLink } from "react-router-dom";
import _ from "lodash";
import { history } from "../../App";

const { Header, Content, Sider } = Layout;
const { SubMenu } = Menu;

const AdminTemplate = (props) => {
  const { Component, ...restProps } = props;
  const { userLogin } = useSelector((state) => state.QuanLyNguoiDungReducer);

  const [collapsed, setCollapsed] = useState(false);

  const onCollapse = (collapsed) => {
    setCollapsed(collapsed);
  };

  useEffect(() => {
    window.scrollTo(0, 0);
  });

  if (!localStorage.getItem(USER_LOGIN)) {
    alert("Bạn không có quyền truy cập vào trang này !");
    return <Redirect to="/" />;
  }

  if (userLogin.maLoaiNguoiDung !== "QuanTri") {
    alert("Bạn không có quyền truy cập vào trang này !");
    return <Redirect to="/" />;
  }

  const menu = (
    <Menu>
      <Menu.Item>
        <button
          onClick={() => {
            localStorage.removeItem(USER_LOGIN); localStorage.removeItem(TOKEN);
            history.push("/login");
            window.location.reload();
          }}>
          Đăng xuất
        </button>
      </Menu.Item>
      <Menu.Item>
        <button
          onClick={() => { history.push("/"); window.location.reload(); }}>
          Trang chủ
        </button>
      </Menu.Item>
    </Menu>
  );

  const operations = (
    <Fragment>
      {!_.isEmpty(userLogin) ? (
        <Dropdown overlay={menu}>
          <button className="ant-dropdown-link text-white" onClick={(e) => e.preventDefault()}>
            Hello {userLogin.taiKhoan} <DownOutlined />
          </button>
        </Dropdown>
      ) : ("")}
    </Fragment>
  );

  return (
    <Route {...restProps} render={(propsRoute) => {
      return (
        <Fragment>
          <Layout style={{ minHeight: "100vh" }}>
            <Sider collapsible collapsed={collapsed} onCollapse={onCollapse}>
              <div className="logo p-3 text-white text-xl text-center">
                <MenuOutlined className="cursor-pointer" />
              </div>
              <Menu theme="dark" defaultSelectedKeys={["1"]} mode="inline">
                <SubMenu key="sub1" icon={<UserOutlined />} title="Users">
                  <Menu.Item key="1" icon={<UnorderedListOutlined />}>
                    <NavLink to="/admin/users">User List</NavLink>
                  </Menu.Item>
                  <Menu.Item key="2" icon={<UserAddOutlined />}>
                    <NavLink to="/admin/users/addnew">Add new</NavLink>
                  </Menu.Item>
                </SubMenu>

                <SubMenu key="sub2" icon={<VideoCameraOutlined />} title="Films">
                  <Menu.Item key="3" icon={<UnorderedListOutlined />}>
                    <NavLink to="/admin/films">Film List</NavLink>
                  </Menu.Item>
                  <Menu.Item key="4" icon={<PlusOutlined />}>
                    <NavLink to="/admin/films/addnew">Add new</NavLink>
                  </Menu.Item>
                </SubMenu>
              </Menu>
            </Sider>
            <Layout className="site-layout">
              <Header className="site-layout-background" style={{ padding: 0 }} >
                <div className="text-right pr-10 pt-1">{operations}</div>
              </Header>
              <Content style={{ margin: "0 16px" }}>
                <Breadcrumb style={{ margin: "16px 0" }}></Breadcrumb>
                <div className="site-layout-background" style={{ padding: 24, minHeight: "85vh" }}>
                  <Component {...propsRoute} />
                </div>
              </Content>
            </Layout>
          </Layout>
        </Fragment>
      );
    }}
    />
  );
};

export default AdminTemplate;
